import { useState } from 'react';
import styles from '../../styles/searchbar.module.css';

const Searchbar = () => {

  const [url, setUrl] = useState();

  return (
    <div className={styles.searchbar}>
      <input
        type="text"
        name="searchbar"
        spellcheck="false"
        value={url}
        onChange={(e) => setUrl(e.target.value)}
      />
      <div>
        <span>Options</span>
        <div></div>
      </div>
      <button type="button" onClick={console.log('Searchbar Clicked')}>Create Playlist</button>
    </div>
  )
}

export default Searchbar
